import { Button } from '@mui/material';
import Cookies from '../logo.svg';
import logo from '../logo.svg';

export default function Home() {

  const islogged = Cookies.get("islogged");
  
  const isloggedText = islogged ? <p>Logueado correctaente</p> : <p>Sin loguearse</p>

  const handlelogin=()=>{

    const body ={
      username: "admin@asd.com",
      password: 1234
    }

    const options ={
      withCredentials: true
    }

    axios.post("http://localhost:3001/auth/login",body, options)
    .then(body=>{
      console.log(body)
    })
    .catch(e =>console.log(e));
  }
  const logInButton = <Button onClick={handlelogin} variant="contained" color="error" >Login</Button>

return (
  <div className="App">
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      {isloggedText}
      {logInButton}
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </header>
  </div>
);
}
